INSERT INTO `tbl_journals` (`id`, `title`, `published_date`, `journal_pdf`, `journal_introduction`, `journal_volume`, `location`, `published_organization`, `online_reading_link`, `journal_cover_photo`, `contact_with_name`, `contact_with_phone`, `contact_with_pemail`, `public_private`, `journal_type`, `paid_type`, `total_read`, `insert_by`, `insert_time`) VALUES
(57, 'Allergen Skin Test Reactivity and Eosinophilia in Adult Bronchial Asthmatic Patients', '2011-01-01', 'assets/journalsPhoto/VolNo_20220907112330.pdf', 'Asthma affects more than 100 million people worldwide. Increased morbidity is multifactorial and may\r\ninclude increased exposure to indoor allergens and environmental pollutants, overuse of beta-2\r\nagonist, under-use of anti-inflammatory mediators and limited education about health care. Allergy\r\nrepresents a specific alteration in biologic reactivity mediated by an immunologic mechanism and\r\nresulting in an adverse physiologic response. Some of the type of allergen’s sensitivity by skin prick\r\ntest (SPT) and blood eosinophil count were studied in adult asthmatic patients to find out their status\r\nin this group of patients and also to observe their relationships. This study was carried out in the\r\nDepartment of Physiology, Bangabandhu Sheik Mujib Medical University, Dhaka and Asthma Centre,\r\nMohakhali, Dhaka from January 2005 to December 2005. Allergen skin prick tests were done by\r\nPepy’s skin prick method and absolute eosinophil count in blood was also done by haemocytometry on\r\n30 asthmatic patients and 30 age and sex matched control subjects. Data were analyzed statistically\r\nby unpaired student’s t-test and Chi-square test. In this study, maximum numbers of asthmatic patients\r\nhad positive SPT for dust mite, which was followed by house dust and by cockroach. Frequency\r\npercentage for dust mite was significantly higher (p <0>0.05 ). Therefore, it can be concluded\r\nthat different allergens like, house dust, dust mite and cockroach are responsible for bronchial asthma\r\nin our country, which can be detected by SPT. Thus it can be used for identification of type of actual\r\nallergens responsible for bronchial asthma. This may be a useful measure for earlier detection of\r\nallergens and for hyposensitization or desensitization of that patients accordingly with those allergens.', 'V - 01        N - 01', '', 'Journal Uttara Adhunik Medical College', '', 'assets/journalsPhoto/VolNopage_20220907112330.jpg', '', '', '', 1, 1, 2, '1', 2, '2022-09-07 11:23:30'),
(58, 'Complete Rectal Prolapse – Management by Delorme’s Procedure', '2011-01-01', 'assets/journalsPhoto/VolNo_20220907113254.pdf', 'Many surgical procedures have been suggested to treat total prolapse of rectum. Delorme’s procedure\r\nis suitable for elderly patients. 24 patients were operated in Uttara Adhunik Medical college hospital\r\nfrom February 2007 to December 2010. Mean hospital stay was 2-4 days .No mortality occurred and\r\nmorbidity was minimal. Post operative watery discharge was found in 7 patients with follow-up of 3\r\nyears. There was no pain in 13 patients, mild pain occurred in 9 cases. Satisfaction with surgery was\r\nhigh in all cases. Anal continence improved in all patients and there was no surgery associated\r\nconstipation. However the controversy “which operation is appropriate ?” is not resolved in published\r\nseries. No standardized diagnostic assessment is available at present. Rectal prolapse is not\r\nuncommon; however, the true incidence is unknown because of underreporting, especially in the\r\nelderly population. Peak in occurrence are noted in the fourth and seventh decades of life, and 15\r\npatients are women in this series.\r\nThe condition is often concurrent with pelvic floor descent and prolapse of other pelvic floor organs,\r\nsuch as the uterus or the bladder. Although multiple pregnancies are often implicated in the aetiology,\r\nit can occur in nulliparous. Evaluation and treatment of children with rectal prolapse is different from\r\nthat for adults and is not addressed in this article.', 'V - 01        N - 01', '', 'Journal Uttara Adhunik Medical College', '', 'assets/journalsPhoto/VolNopage_20220907113254.jpg', '', '', '', 1, 1, 2, '1', 2, '2022-09-07 11:32:54'),
(59, 'Urinary Tract Infection in Nephrotic Child - How Common is it?', '2011-01-01', 'assets/journalsPhoto/VolNo_20220907113635.pdf', 'Infections result in significant morbidity and may also be responsible for a poor response to steroid\r\ntherapy or induce relapse in a child with Nephrotic Syndrome (NS) who has already attained remission.\r\nThere is little information about the incidence of urinary tract infection (UTI) with NS in our country.\r\nThis study aims to find out the frequency, aetiology and predisposing factors of UTI in children with\r\nNS. It was a prospective study done in Uttara Adhunik Medical College during the period of January\r\n2007 to June 2010. Consecutive 90 cases of Nephrotic Syndrome, age between 1 year to 10 years,\r\nwho fulfill the ISKDC criteria, were enrolled in the study. Patients getting antibiotic prior to hospital\r\nadmission were excluded. Only culture-proven UTI cases were taken. A positive urine culture was\r\ndefined as midstream clean voided specimen in a patient with isolation of > 105\r\nml of single organism.\r\nTotal 90 patients were studied. Among them 32 (35.5%) patients had 1st attack and 58 (64.4%)\r\npatients were relapsed. Mean age was 4 years 8 months (range 1 year 2 months to 10 years) with\r\nmale:female ration of 1.57:1. Total 38 (42.2%) patients had UTI. Among them 11 (28.9%) patients had\r\ninitial attack and 27 (71.1%) patients had relapse (p value >0.05). Asymptomatic infections were\r\nmore common presentation. Patients with UTI had lower serum total protein (4.20 ± 1.03 g/dl) and\r\nserum total albumin level (2.03 ± 0.68 g/dl) than those nephrotic patients without UTI (5.25 ± 1.21 g/\r\ndl; 2.59 ± 0.85 g/dl; p value &lt;0.01, &lt;0.01 respectively). Serum cholesterol level was also high (11.66\r\n± 3.72 mmol/l) in nephrotic patients with UTI than those without UTI (9.71 ± 7.61 mmol/l; p value\r\n&lt;0.02). Blood urea and serum creatinine level were not significantly different between two groups.\r\nEscherichia coli was the most common organism, found in 30 (78.94%) cases. Netilmycin was the\r\nonly drug which was sensitive to all organisms. Incidence of UTI in NS is quite common and it is more\r\nsignificant in low serum albumin level.', 'V - 01        N - 01', '', 'Journal Uttara Adhunik Medical College', '', 'assets/journalsPhoto/VolNopage_20220907113635.jpg', '', '', '', 1, 1, 2, '0', 2, '2022-09-07 11:36:35'),
(60, 'Comparative Study of Doxycycline and Azithromycin in Respect of Efficacy, Safety And Tolerance in Treatment of Acne Vulgaris', '2011-01-01', 'assets/journalsPhoto/VolNo_20220907115328.pdf', 'There is lot of modalities of treatment to manage Acne vulgaris of which topical and systemic\r\napplication of Antibiotic has overall very good effect. The study is carried on in a comparative way\r\nbetween doxycycline and azithromycin to assess the efficacy, safety and tolerance of the patient\r\nagainst the drug with Acne vulgaris. This was a cross sectional study among randomly selected 100\r\npatients of classical Acne vulgaris of 12-45 years of both sexes, from Jan to Dec 2008 attending\r\nOPD of Skin VD department of UAMCH. Overall study was carried out to see the efficacy of drugs and\r\nalso to determine the course duration of medication to have optimum outcome.', 'V - 01        N - 01', '', 'Journal Uttara Adhunik Medical College', '', 'assets/journalsPhoto/VolNopage_20220907115328.jpg', '', '', '', 1, 1, 2, '0', 2, '2022-09-07 11:53:28'),
(61, 'Primary Gastric Lymphoma: Literature Review and Report of a Case', '2011-01-01', 'assets/journalsPhoto/VolNo_20220907115612.pdf', 'Primary gastric lymphoma is a rare and an interesting tumour accounting for less than 5% of primary\r\ngastric neoplasm. It can present in different forms. Different clinical presentations, natural history,\r\ndiagnostic work-up and different modalities of treatment protocols have been studied thoroughly\r\nfrom different literatures. All these have been put forward in this article together with presentation of\r\na case, which was primarily diagnosed as adenocarcinoma of the stomach.', 'V - 01        N - 01', '', 'Journal Uttara Adhunik Medical College', '', 'assets/journalsPhoto/VolNopage_20220907115612.jpg', '', '', '', 1, 1, 2, '2', 2, '2022-09-07 11:56:12'),
(62, 'Ehlers-Danlos Syndrome in Pregnancy: An Uncommon Disorder - Common Dilemma in Delivery Room', '2011-01-01', 'assets/journalsPhoto/VolNo_20220907120821.pdf', 'The occurrence of pregnancy in females with Ehlers-Danlos syndrome is not common. This is a rare\r\ninherited connective tissue disorder that has been associated with numerous pregnancy complications\r\nranging from bruising to maternal death. More than 10 variants of the Ehlers Danlos syndrome have\r\nbeen identified based upon either biochemical or clinical findings, and different major and minor\r\ndiscriminatory criteria have been defined for each. A case of pregnancy of a 25-year-old primigravida\r\nwith Ehlers-Danlos syndrome is reported here. The patient delivered spontaneously 10 hours after\r\nactive labour started. She had no undue complication during labour and at postpartum period.', 'V - 01        N - 01', '', 'Journal Uttara Adhunik Medical College', '', 'assets/journalsPhoto/VolNopage_20220907120821.jpg', '', '', '', 1, 1, 2, '0', 2, '2022-09-07 12:08:21'),
(63, 'Inclusion Epidermoid Cyst in Head & Neck Region - Two Case Report', '2011-01-01', 'assets/journalsPhoto/VolNo_20220907121118.pdf', 'Epidermoid cyst infrequently occurs in head & neck region. 7% of the epidermoid & dermoid cyst\r\noccurs in the head & neck region & 1.6% within the oral cavity. They represent less then 0.01% of all\r\noral cavity cyst. We report two cases of epidermoid cyst, one in the sublingual region & another one\r\nin the anterior neck. Both the cysts are preoperatively evaluated by ultrasonography & FNAC.\r\nSonography revealed a well defined hypoechoic cystic mass. ', 'V - 01        N - 01', 'Sector - 9, Uttara, Dhaka ', 'Journal Uttara Adhunik Medical College', '', 'assets/journalsPhoto/VolNopage_20220907121118.jpg', '', '', '', 1, 1, 2, '1', 2, '2022-09-07 12:11:18'),
(64, 'Cat-scratch Disease - A Case Report', '2011-01-01', 'assets/journalsPhoto/VolNo_20220907122354.pdf', 'A 9 years old male child was admitted in the department of surgery of UAMCH, Dhaka with unilateral\r\npainful inguinal lymphadenopathy, fever, anorexia and generalized weakness. He was diagnosed as\r\na case of inguinal abscess with lymphadenopathy. Incision & drainage followed by inguinal lymph\r\nnode biopsy was performed under general anesthesia. Scanty pus drained out, enlarged matted\r\ncapsulated lymph nodes were found, centre filled with caseous necrotic material. We excised 4 to 5\r\nlymph nodes for histopathological examination and the wound was kept open. In his post operative\r\nperiod he was on antibiotics (cephalosporin), analgesics, antiemetics & antiulcerants. Daily dressing\r\nof the wound was performed for 7 days, the wound became healthy & it healed up very nicely. So,\r\nsecondary closure wasn’t needed. Histopathology report of inguinal lymph nodes reveals granuloma\r\nwith features suggestive of Cat-scratch disease (CSD). The case of our patient illustrates the need\r\nto consider cat-scratch disease in the differential diagnosis of lymphadenopathy.', 'V - 01        N - 01', 'Sector - 9, Uttara, Dhaka ', 'Journal Uttara Adhunik Medical College', '', 'assets/journalsPhoto/VolNopage_20220907122354.jpg', '', '', '', 1, 1, 2, '2', 2, '2022-09-07 12:23:54'),
(65, 'Topiramate versus Lamotrigine in Migraine Prophylaxis: A Double Blinded Crossover Clinical Trial', '2011-07-02', 'assets/journalsPhoto/VolNo_20220907135650.pdf', 'The objective of the present study was to assess and compare the efficacy and safety of\r\ntopiramate and lamotrigine for prophylaxis in migraine. Sixty four patients with frequent\r\nmigraine (more than 4 attacks per month) from the headache clinic at a tertiary referral\r\ncentre in Bangladesh were randomized to receive 50 mg topiramate and lamotrigine for 1\r\nmonth each in 2 divided doses. The study was in 4 phases in a crossover manner with a\r\nwashout period of 7 days in between.', 'V - 01        N - 02 ', 'Sector - 9, Uttara, Dhaka ', 'Journal Uttara Adhunik Medical College', '', 'assets/journalsPhoto/VolNopage_20220907135650.jpg', '', '', '', 1, 1, 2, '9', 2, '2022-09-07 13:56:50'),
(66, 'Colonoscopic Evaluation of Diarrhea in Bangladesh', '2011-07-02', 'assets/journalsPhoto/VolNo_20220907143059.pdf', 'Diarrhoea is a universal human experience. Chronic diarrhoea can have a\r\nsubstantial impact on quality of life and overall health. Chronic diarrhoea is a common complaint\r\nof patients presenting to family practitioners, internists, and gastroenterologists. There are\r\nmany possible causes of chronic diarrhoea; identifying the underlying cause ensures that the\r\nappropriate treatment would be employed. A colonoscopy is generally recommended when\r\nthe patient complains of rectal bleeding, has a change in bowel habits, and/or has other\r\nunexplained abdominal symptoms.The test also enables physicians to check for bowel diseases\r\nsuch as ulcerative colitis and Crohn’s disease and is an essential tool for monitoring patients\r\nwho have a past history of polyps or colon cancer. Colonoscopy is being used increasingly as\r\na screening tool in both asymptomatic patients and patients at risk for colon cancer. It has been\r\nrecommended as a screening test in all people 50 years or older.', 'V - 01        N - 02 ', 'Sector - 9, Uttara, Dhaka ', 'Journal Uttara Adhunik Medical College', '', 'assets/journalsPhoto/VolNopage_20220907143059.jpg', '', '', '', 1, 1, 2, '0', 2, '2022-09-07 14:30:59'),
(67, 'Efficacy of AST/ALT Ratio for Assessment of Liver Fibrosis in Chronic Hepatitis B Infection', '2011-07-02', 'assets/journalsPhoto/VolNo_20220907145427.pdf', 'Chronic liver disease due to hepatitis B infection is a common problem in our country. The\r\nsole method of accurate diagnosis is liver biopsy, which is an invasive technique associated\r\nwith complications, and is expensive. The main aim of the current study is to evaluate the\r\nefficacy of indirect serum markers for diagnosis of severity and extent of fibrosis in patients\r\nwith chronic hepatitis B. This is a cross-sectional study on serum aspartate aminotransferase\r\n- serum alanine aminotransferase ratio (AST/ALT ratio) in patients with liver fibrosis following\r\nchronic Hepatitis B infection. The study was done on a total of 50 biopsy-diagnosed,\r\ntreatment-naive Hepatitis B patients. Serum AST and ALT were estimated by Kinetic UV\r\nmethod. Fibrosis was scored according to the Scheuer scheme. Data were analyzed\r\nstatistically by Spearman’s rank correlation using SPSS software version 12. Mean AST/\r\nALT ratio was found to be 0.92 ± 0.28. AST/ALT ratio shows almost no correlation with mild\r\nor significant fibrosis by Spearman’s rank correlation coefficient (r = 0.118; p >0.1). It can\r\nthus be concluded from this study that AST/ALT ratio has low diagnostic accuracy for\r\npredicting significant fibrosis and cirrhosis in individuals with chronic hepatitis B infection.', 'V - 01        N - 02', '', 'Journal Uttara Adhunik Medical College', '', 'assets/journalsPhoto/VolNopage_20220907145344.jpg', '', '', '', 1, 1, 2, '0', 2, '2022-09-07 14:53:44'),
(68, 'Oral Health Edification and Changing Behavior to Eradicate the Dental Caries in Bangladesh', '2011-07-02', 'assets/journalsPhoto/VolNo_20220907151136.pdf', 'Dental caries is a disease of the teeth that happens over a lifetime, with highest priority risk\r\ngroup between 12-50 years of age. Environmental factors such as education, socioeconomic\r\nstatus, life style and dietary pattern can have a greater impact on caries-resistance or\r\ndevelopment. The present study was performed to evaluate the relationship between dental\r\ncaries, oral hygiene status and risk factors among the patients attending out-patient department\r\nof Sapporo Dental College and Hospital, Dhaka. Oral examination was performed in 425\r\nindividuals aged between 12 and 50 years to check decayed teeth and simplified oral\r\nhygiene (OHI-S) score. A questionnaire was distributed to gather data concerning external\r\nmodifying risk factors such as socioeconomic status and oral hygiene practices. It was found\r\nthat 88.2% of the total population had clear concept about prevention dental diseases by\r\nusing tooth paste and tooth brush. Among them 90.7% peoples used tooth paste and brush\r\nto clean their teeth. Caries experience was significantly inversely related to socio-economic\r\nstatus whereas strongly correlated with pattern of oral hygiene maintenance. The study\r\nshows people of good oral hygiene have low number of carious teeth and poor oral hygiene\r\npeople have more number of carious teeth. Educated and higher monthly income people’s\r\noral hygiene status was better than illiterate and lower income people.', 'V - 01        N - 02', 'Sector - 9, Uttara, Dhaka ', 'Journal Uttara Adhunik Medical College', '', 'assets/journalsPhoto/VolNopage_20220907151136.jpg', '', '', '', 1, 1, 2, '0', 2, '2022-09-07 15:11:36'),
(69, 'Post-anaesthesia care', '2011-07-02', 'assets/journalsPhoto/VolNo_20220907151539.pdf', 'Lots of developments and innovations have taken place in anaesthesiology. Now\r\nanaesthesia is safe and has made surgery comfortable and safe as well. Neglected part of\r\nconcern is Post- anaesthesia care. Improper post-anaesthesia care leads to good number\r\nof morbidities as well as mortalities in post-operative period.\r\nThis article emphasizes on the need for adequate and modern post-anaesthesia care.\r\nMaterials are collected from different recent literature', 'V - 01        N - 02', 'Sector - 9, Uttara, Dhaka ', 'Journal Uttara Adhunik Medical College', '', 'assets/journalsPhoto/VolNopage_20220907151539.jpg', '', '', '', 1, 1, 2, '1', 2, '2022-09-07 15:15:39'),
(70, 'Noninvasive Stool Antigen Test (HpSA) to Diagnose H. Pylori Infection – A Contemporary Review', '2011-07-02', 'assets/journalsPhoto/VolNo_20220907152833.pdf', 'Helicobacter pylori is a bacteria which has been accepted as a major contributor to the\r\ndevelopment of gastric cancer. There are calls to investigate the potential to eradicate H\r\npylori in high risk populations. The accurate diagnosis of a subject’s H pylori status is\r\nimportant for correct therapy and additionally for eradication programmes. The Helicobacter\r\npylori load in both stomach and stool and the resulting severity of gastritis are important\r\ncriteria in validating the status of H. pylori infection. A breath or stool test is usually done\r\nafter finishing the medication. There are several diagnostic tests with a variety of modalities\r\nto evaluate a patient’s H pylori status. Rapid faecal H pylori antigen tests are becoming\r\nmore widely used due to their low equipment requirements and ease of use. These tests\r\nare generally based on immunochromatographic reactions between monoclonal antibodies\r\nto H pylori and H pylori antigens that may be present in the patient stool sample', 'V - 01        N - 02', 'Sector - 9, Uttara, Dhaka ', 'Journal Uttara Adhunik Medical College', '', 'assets/journalsPhoto/VolNopage_20220907152833.jpg', '', '', '', 1, 1, 2, '0', 2, '2022-09-07 15:28:33'),
(71, 'Idiopathic Oedema', '2011-07-02', 'assets/journalsPhoto/VolNo_20220907154558.pdf', 'Idiopathic oedema is a syndrome of fluid retention occurring in premenopausal women in\r\nthe absence of cardiac, hepatic, or renal disease and other known causes of oedema. The\r\ncommunity prevalence of such symptoms, their association with other symptoms, and their\r\nunderlying aetiology, are uncertain. The disorders occur almost exclusively in women,\r\nshow diurnal (postural), not “cyclic” fluctuations in severity, often cause discomfort and\r\noccasionally pain, and may be aggravated by prolonged orthostasis, hot environments,\r\nmenses, and some drugs. The pathophysiology of idiopathic oedema remains poorly\r\nunderstood and this hinder a rational approach to treatment. The variable presentation\r\nand paucity of physical signs in idiopathic oedema may commonly delay diagnosis which\r\nresults in unnecessary investigations and hazardous treatment. Again, no specific drug or\r\ntreatment guideline is yet available for this syndrome. So it is very important when should\r\nbe an oedema be regarded as “Idiopathic” and when and what treatment should be given.\r\nThis review has been done with a view to have a better approach to a patient with idiopathic\r\noedema and thus a rational management.', 'V - 01        N - 02', 'Sector - 9, Uttara, Dhaka ', 'Journal Uttara Adhunik Medical College', '', 'assets/journalsPhoto/VolNopage_20220907160714.jpg', '', '', '', 1, 1, 2, '1', 2, '2022-09-07 15:45:58'),
(72, 'Polyarticular Presentation of Gout and Optimizing the Management Strategy to Prevent Its Development', '2011-07-02', 'assets/journalsPhoto/VolNo_20220907155524.pdf', 'Along with the increase in the number of gout patients, the polyarticular form of presentation\r\nis also increasing. We present a case of a 42 year old Chinese male patient with Polyarticular\r\ntophaceous gout, who suffered multiple acute gouty flares during last 10 years. The current\r\npolyarticular presentation caused him a significant morbidity, working-day loss, prolong\r\nhospital stay and poor functional outcome. This case serves to highlight inadequate patient\r\neducation, suboptimal medical therapy and misconceptions among physicians regarding\r\ngout management. All these factors contributed to his development of polyarticular\r\ntophaceous gout. We also searched literature for finding the important reasons that lead to\r\nthe suboptimal management of gout and hence the development of lingering gout.', 'V - 01        N - 02', 'Sector - 9, Uttara, Dhaka ', 'Journal Uttara Adhunik Medical College', '', 'assets/journalsPhoto/VolNopage_20220907155524.jpg', '', '', '', 1, 1, 2, '1', 2, '2022-09-07 15:55:24'),
(73, 'Grynfelt Hernia (Superior Lumbar): A Case Report', '2011-07-02', 'assets/journalsPhoto/VolNo_20220907160603.pdf', 'Lumbar hernia is not very frequently encountered in clinical practice. A patient with lumbar\r\nhernia presented to the department of surgery. Because of its rarity, the case is reported.', 'V - 01        N - 02', 'Sector - 9, Uttara, Dhaka ', 'Journal Uttara Adhunik Medical College', '', 'assets/journalsPhoto/VolNopage_20220907160603.jpg', '', '', '', 1, 1, 2, '1', 2, '2022-09-07 16:06:03'),
(74, 'Assessment of Cardiac Autonomic Nerve Function Status by Heart Rate Variability in Hypothyroidism', '2012-01-01', 'assets/journalsPhoto/VolNo_20220912105930.pdf', 'Hypothyroidism is one of the common endocrine disorders with high incidence in women particularly in older age.Impaired cardiac autonomic activity and altered sympathovagal balance are documented in patients with hypothyroidism.', 'V - 02     N - 01', 'Sector - 9, Uttara, Dhaka ', 'Journal Uttara Adhunik Medical College', '', 'assets/journalsPhoto/VolNopage_20220912161702.jpg', '', '', '', 1, 1, 2, '7', 2, '2022-09-12 10:59:30'),
(75, 'Status of Liver Functions in Dengue Fever', '2012-01-01', 'assets/journalsPhoto/VolNo_20220912113038.pdf', 'Dengue fever, particularly its haemorrhagic form, is a serious\r\nhealth problem in tropical countries. In Bangladesh dengue infection has become an\r\nendemic disease since it broke out in June 2000. Liver involvement in dengue is not a\r\ncommon feature, though it usually leads to a protracted illness. This study investigated\r\nclinical & biochemical manifestations of liver involvement in dengue patients.', 'V - 02     N - 01', 'Sector - 9, Uttara, Dhaka ', 'Journal Uttara Adhunik Medical College', '', 'assets/journalsPhoto/VolNopage_20220912113038.jpg', '', '', '', 1, 1, 2, '0', 2, '2022-09-12 11:30:38'),
(76, 'Presenting Complains, Operative Findings and Outcome of Acute Abdomen in a District Hospital-A Retrospective Study of 100 Cases', '2012-01-01', 'assets/journalsPhoto/VolNo_20220912115713.pdf', 'Patients with acute abdominal pain have a significant morbidity and mortality both in developed\r\ncountries and in our country. The purpose of this study is to find out the presenting complains,\r\noperative findings and outcome of acute abdomen in a district hospital. Hundred (100) patients\r\ndiagnosed and operated as acute abdomen that were admitted in surgical department of\r\nSadar Hospital, Lalmonirhat, from October 2006 to October 2008 were taken as sample.\r\nThese patients were diagnosed on the basis of detailed history, physical examinations and\r\nrelevant diagnostic investigations and after laparotomy final diagnosis were made. Initial clinical\r\ndiagnosis was compared with final diagnosis. Outcome of management of these patients with\r\ncauses of morbidity, mortality and referral of patients to tertiary hospital were identified.\r\nMajority of the patient were in age group of 10-20 (28%) and 21-30 (28%). Overall malefemale ratio was 1.22:1, but there were disease specific variations. Acute abdominal pain\r\nwas the constant symptom in all cases, of them 82% presented with severe local or diffuse\r\nabdominal pain.', 'V - 02     N - 01', 'Sector - 9, Uttara, Dhaka ', 'Journal Uttara Adhunik Medical College', '', 'assets/journalsPhoto/VolNopage_20220912115713.jpg', '', '', '', 1, 1, 2, '1', 2, '2022-09-12 11:57:13'),
(77, 'Flap Coverage for Management of Pressure Sore', '2012-01-01', 'assets/journalsPhoto/VolNo_20220912120816.pdf', 'Pressure ulcers have a substantial impact on the health-related quality of life of patients and\r\nin terms of the financial burden on the health service, patients and their families and society\r\nas a whole. Grade III & IV sores almost always need some form of flap coverage. In Uttara\r\nAdhunik Medical College Hospital 20 grade IV pressure sores of 16 patients were managed\r\nby Gluteal, Tensor fascia lata and sural island flaps. All flaps survived and healed in course\r\nof time with very minimal complications. Only 1 flap was totally dehiscent even after 2nd time\r\napplication. Meticulous debridement, proper homeostasis, tensionless closure keeping\r\nsuction drain for prolonged time, avoidance of weight bearing over flap for long time and\r\ncorrection of all provocating factors can reduce the complications related to the flap.', 'V - 02     N - 01', 'Sector - 9, Uttara, Dhaka ', 'Journal Uttara Adhunik Medical College', '', 'assets/journalsPhoto/VolNopage_20220912120816.jpg', '', '', '', 1, 1, 2, '1', 2, '2022-09-12 12:08:16'),
(78, 'Epidemiological Pattern of Ischemic Heart Disease among The Patients Attending Tertiary Level Hospital In Dhaka City', '2012-01-01', 'assets/journalsPhoto/VolNo_20220912122516.pdf', 'Background: Ischaemic heart disease is the most common form of heart disease and\r\na major cause of hospital admission as well as the single most important cause of\r\ndeath all over the world. Epidemiological and statistical data regarding ischaemic heart\r\ndisease were very few in number in Bangladesh. Objectives: To evaluate the association\r\nbetween socio-demographic factors and ischaemic heart disease among the patients\r\nattending tertiary level hospitals in Dhaka city. Methods: This was a case control study\r\nconducted in Sir Salimullah Medical College & Mitford Hospital, National Institute of\r\nCardiovascular Diseases and Lab Aid Cardiac Hospital, Dhaka for a period of four\r\nmonths (September, 2010 to December, 2010). Study variables were age, sex, religion,\r\npattern of occupation, monthly income, level of education and type of family. From\r\nthree hundred and sixteen respondents, 158 were the cases of ischaemic heart disease\r\nand equal number of patients other than ischaemic heart disease was selected as\r\ncontrol group. Diagnosis of ischaemic heart disease was confirmed by\r\nelectrocardiogram. Results: Mean age of the cases and controls were 58.74 ± 11.87\r\nand 43.71 ± 13.31 respectively. Males had a higher (80.4%) prevalence of ischaemic\r\nheart disease than females (19.6%). It has also been found that Ischaemic heart disease\r\nwas significantly associated with age, sex, sedentary life style, family type and monthly\r\nincome. Conclusion: Increasing age, male sex, sedentary life style, joint family, and\r\nhigh income has an influence of getting ischaemic heart disease.', 'V - 02     N - 01', 'Sector - 9, Uttara, Dhaka ', 'Journal Uttara Adhunik Medical College', '', 'assets/journalsPhoto/VolNopage_20220912122516.jpg', '', '', '', 1, 1, 2, '1', 2, '2022-09-12 12:25:16'),
(79, 'Role of Spinal Mobilizing Exercises in Low Back Pain (LBP) of Sedentary Office Worker Attending in Physiotherapy Department of UAMCH, Dhaka', '2012-01-01', 'assets/journalsPhoto/VolNo_20220912123256.pdf', 'Low back pain (LBP) is a common problem of sedentary office worker. There is a very\r\ngood role of spinal mobilizing exercise in low back pain. The study was designed to\r\nestimate the pattern and status of Low Back Pain among the sedentary office workers\r\nworking at public or private organization in Dhaka city with their age, official arrangement,\r\nduration and type of work and compare the effect of the mobilizing exercise with or without\r\nelectrotherapy. It was a descriptive cross-sectional study. For the qualitative part of the\r\nstudy 100 patients were selected who have taken treatment from Physiotherapy department\r\nof UAMCH at least for 8 weeks with or without spinal mobilizing exercise. The study was\r\nconducted from February 2010 to July 2010.', 'V - 02     N - 01', 'Sector - 9, Uttara, Dhaka ', 'Journal Uttara Adhunik Medical College', '', 'assets/journalsPhoto/VolNopage_20220912123256.jpg', '', '', '', 1, 1, 2, '1', 2, '2022-09-12 12:32:56'),
(80, 'Abdominal Cocoon; Unusual Presentation of Acute Intestinal Obstruction at Laparotomy', '2012-01-01', 'assets/journalsPhoto/VolNo_20220912124118.pdf', 'Abdominal cocoon (AC) is an unusual cause of small-bowel\r\nobstruction that results from encasement of variable lengths of bowel by a dense\r\nfibrocollagenous cocoon-like membrane. The primary or idiopathic AC is rare and AC of\r\ntuberculous origin is even more infrequent. But, such cases are more confined to the tropics\r\nand subtropical regions where tuberculosis tends to be endemic. Diagnosis is seldom made\r\npreoperatively. Patients attending the hospital emergency usually get admitted with features\r\nof intestinal obstruction. In addition to these, the history of recurrent episodes of obstruction\r\nin these patients appeared to be an important clinical characteristic. Surgical resection of the\r\ncocoon to release the entrapped bowel is the preferred treatment. Postoperative histopathology\r\nis confirmatory. This study was undertaken to analyze the demographic presentation of the\r\nAC patients experienced in a tertiary care hospital like ours and to evaluate the\r\nhistopathological features of resected cocoon secondary to tuberculosis. ', 'V - 02     N - 01', 'Sector - 9, Uttara, Dhaka ', 'Journal Uttara Adhunik Medical College', '', 'assets/journalsPhoto/VolNopage_20220912124118.jpg', '', '', '', 1, 1, 2, '0', 2, '2022-09-12 12:41:18'),
(81, 'Postnatal Care of Women and Their Babies', '2012-01-01', 'assets/journalsPhoto/VolNo_20220912124352.pdf', 'Newborn survival is inextricably linked to the health of the mother. For both newborns and\r\nmothers, the highest risk of death occurs at delivery, followed by the first hours and days\r\nafter child birth. The postnatal period (the time just after delivery and through the first six\r\nweeks of life) is specially critical for newborns and mothers.\r\nThe first days after birth, the early postnatal period is the ideal time to deliver interventions\r\nto improve the health and survival of both the newborn and the mother. Yet policies and\r\nprograms have largely overlooked this critical time, hindering efforts to meet the Millennium\r\nDevelopment Goals (MDGs) for maternal and child survival.', 'V - 02     N - 01', 'Sector - 9, Uttara, Dhaka ', 'Journal Uttara Adhunik Medical College', '', 'assets/journalsPhoto/VolNopage_20220912124352.jpg', '', '', '', 1, 1, 2, '1', 2, '2022-09-12 12:43:52'),
(82, 'Periprostatic Local Anaesthesia Vs Intraprostatic Local Anaesthesia for Ultrasonoguided Transrectal Prostatic Biopsy - A Comprehensive Literature Review', '2012-01-01', 'assets/journalsPhoto/VolNo_20220912124938.pdf', 'Prostatic cancer has varied clinical presentations. Diagnosis of prostate cancer has evolved\r\nthrough the past century. Estimation of serum PSA has more predictive value than diagnostic\r\nvalue. In previous days diagnosis of prostatic cancer relied on three measures\r\nDRE, needle biopsy and open biopsy. With development of medical science different\r\nbiopsy techniques have evolved for prostatic biopsy. Each technique has its own merits\r\nand demerits. The article presented here discusses on different biopsy techniques and\r\ncompares the two techniques, one being ultrasonoguided transrectal prostatic biopsy\r\nfollowing periproststic local anaesthesia and the other being the biopsy following\r\nintraprostatic local anaesthesia . A thorough literature search was done to resolve theses\r\nissues and finally a recommendation is drawn to develop a recommendated policy of\r\nbiopsy for accurate diagnosis of prostatic cancer.', 'V - 02     N - 01', 'Sector - 9, Uttara, Dhaka ', 'Journal Uttara Adhunik Medical College', '', 'assets/journalsPhoto/VolNopage_20220912124938.jpg', '', '', '', 1, 1, 2, '2', 2, '2022-09-12 12:49:38'),
(83, 'Perioperative Fluid Therapy', '2012-01-01', 'assets/journalsPhoto/VolNo_20220912130114.pdf', 'This article is for reviewing the effect of IV fluids, blood & blood-products for maintaining\r\nadequate hydrations, to address hypovolaemia, to avoid fluid overload and its hazards\r\nand to develop awareness about controversy on fluid therapy. In perioperative period,\r\nfluid administration is a routine practice that may improve cardiovascular physiology, endorgan function and possible outcome.\r\nPerioperative fluid replacement in turn has been,and still is the focus of much debate .The\r\ndebate is primarily focused on the use of different types of fluid components available, and\r\nnot on the actual amount of fluid administered. Again the practice of perioperative fluid\r\ntherapy is variable ranging from ‘high volume’ to ‘dry’ volume regimen. Recent reviews\r\nregarding over hydration may have serious effects on cardiac and pulmonary function,\r\nand on recovery of postoperative ileus, tissue oxygenation, wound healing and\r\ncoagulation.Hence ‘dry’ regimen fluid therapy is now focus of attention and getting popularity.', 'V - 02     N - 01', 'Sector - 9, Uttara, Dhaka ', 'Journal Uttara Adhunik Medical College', '', 'assets/journalsPhoto/VolNopage_20220912130114.jpg', '', '', '', 1, 1, 2, '1', 2, '2022-09-12 13:01:14'),
(84, 'Lewy Body Dementia: Case Report and Discussion', '2012-01-01', 'assets/journalsPhoto/VolNo_20220912141042.pdf', 'Lewy body dementia is a common cause of dementia\r\nin the elderly, accounting for perhaps 15% to 25% of\r\ndementia cases.1,2 Evidence suggests that Lewy body\r\ndementia might be under diagnosed, often being\r\nmistaken for the more familiar Alzheimer disease.\r\nClinically the distinction is important, as it can have\r\nprofound implications for management and prognosis.\r\nAn alternative diagnosis of Lewy body dementia can\r\nlead to a trial of treatment that can be associated\r\nwith dramatic improvement in the patient’s symptoms.', 'V - 02     N - 01', 'Sector - 9, Uttara, Dhaka ', 'Journal Uttara Adhunik Medical College', '', 'assets/journalsPhoto/VolNopage_20220912141042.jpg', '', '', '', 1, 1, 2, '1', 2, '2022-09-12 14:10:42'),
(85, 'Chordoma in Nose and Paranasal Sinuses - A Case Report', '2012-01-01', 'assets/journalsPhoto/VolNo_20220912142117.pdf', 'Chordoma is a very rare bony tumour which arises from the notochordal remnants. One\r\ncase of Chordoma in the Nose & Para nasal sinuses was identified in the department of\r\notolaryngology in UAMCH in July 2009. Patient was 44 years lady, Presenting with nasal\r\nobstruction, facial swelling & proptosis. Tumour was treated by surgical excision followed\r\nby radiotherapy. Post operative follow up reveals no recurrence.', 'V - 02     N - 01', 'Sector - 9, Uttara, Dhaka ', 'Journal Uttara Adhunik Medical College', '', 'assets/journalsPhoto/VolNopage_20220912142117.jpg', '', '', '', 1, 1, 2, '0', 2, '2022-09-12 14:21:17'),
(86, 'Radiation Hazards', '2011-01-01', 'assets/journalsPhoto/VolNo_20220912143920.pdf', 'In the recent years a great deal has been said about\r\nthe hazards of radiation, especially in connection with\r\nthe “fall out” from nuclear weapon test, leakage &\r\naccident of nuclear plant. Much of this is exaggerated\r\nand has led to a general fear of radiation by the public,\r\nand refusal, in some cases, of patients to undergo\r\ndiagnostic radiography, therapeutic radiation, nuclear\r\nmedicine, the benefits of which far outweigh the\r\nadverse effects. Radiation may be defined as energy\r\nradiated in the form of a wave as a result of the motion\r\nof electric charges.', 'V - 01        N - 01', 'Sector - 9, Uttara, Dhaka ', 'Journal Uttara Adhunik Medical College', '', 'assets/journalsPhoto/VolNopage_20220912143920.jpg', '', '', '', 1, 1, 2, '2', 2, '2022-09-12 14:39:20'),
(87, 'Problem-based Learning-Strategy For Effective Medical Teaching', '2011-07-02', 'assets/journalsPhoto/VolNo_20220912144835.pdf', 'Medical education at all levels has undergone and is undergoing considerable changes throughout the\r\nworld. Learning is now seen as an individual process. The teacher may impart information but knowledge\r\nwill be built up by the learner depending on what is already known, that is through the individual’s Schema, the building block of cognition. Group discussion can give students the opportunity to investigate in depth into the course and foster critical thinking. Problem-based learning is one of the best ways of promoting active learning. It represents an approach to teaching and learning that is based on research into how adults learn most effectively.', 'V - 01        N - 02', 'Sector - 9, Uttara, Dhaka ', 'Journal Uttara Adhunik Medical College', '', 'assets/journalsPhoto/VolNopage_20220912144835.jpg', '', '', '', 1, 1, 2, '1', 2, '2022-09-12 14:48:35'),
(88, 'Assessment in Medical Education', '2012-01-01', 'assets/journalsPhoto/VolNo_20220912145311.pdf', 'Assessment is a matter of measurement. Medicine\r\nitself is a profession in which accurate and responsible\r\nmeasurement is a cardinal requirement (Millan,\r\n1976)\r\n. Assessment procedures have a powerful\r\ninfluence over learning. Teaching has traditionally been\r\nconsidered a means of imparting knowledge and\r\nassessment that of estimating how much has been\r\nlearnt. Teaching creates a desire to learn and\r\nassessment creates a constructive awareness of\r\nignorance. The two together lead to really meaningful\r\nlearning (Nayar and Bijli, 1987)', 'V - 02     N - 01', 'Sector - 9, Uttara, Dhaka ', 'Journal Uttara Adhunik Medical College', '', 'assets/journalsPhoto/VolNopage_20220912145311.jpg', '', '', '', 1, 1, 2, '0', 2, '2022-09-12 14:53:11'),
(89, 'Caffein, Its Use and Abuse - Recent Update', '2012-07-01', 'assets/journalsPhoto/VolNo_20220912154600.pdf', 'Caffeine is a central nervous system stimulant. It is\r\nlegal and found in many beverages, including coffee,\r\ntea, and colas. It is most widely abused drug in the\r\nworld.1,2 It is a potent and quick-acting drug which\r\nproduces an effect similar to the stress response in\r\nour bodies. Caffeine affects each person differently,\r\ndepending on individual circumstances such as\r\nweight, built, etc. It has an almost instant effect on\r\nmind-body which will continue to influence the state\r\nfor 6-8 hours afterwards3', 'V - 02      N - 02', 'Sector - 9, Uttara, Dhaka ', 'Journal Uttara Adhunik Medical College', '', 'assets/journalsPhoto/VolNopage_20220912161436.jpg', '', '', '', 1, 1, 2, '2', 2, '2022-09-12 15:46:00'),
(90, 'Polytrauma Patients with Abdominal Injury - Experience in a Tertiary Level Hospital', '2012-07-01', 'assets/journalsPhoto/VolNo_20220912160427.pdf', 'Trauma is now recognized as a serious public health problem of modern world which\r\nresults in millions of life loss and loss of effective years from life (disability). Among them\r\nPolytrauma patients have the highest incidence of mortality from injury. Abdominal trauma\r\nis a preventable cause of death if promptly diagnosed and appropriately managed. This\r\nstudy was conducted with an aim to find out pattern of abdominal injury in patients of\r\npolytrauma with abdominal injury, to evaluate effectiveness of current trauma management\r\nprotocol and to identify factors that may contribute to the management of patients suffering\r\nfrom polytrauma with abdominal injury.', 'V - 02      N - 02', 'Sector - 9, Uttara, Dhaka ', 'Journal Uttara Adhunik Medical College', '', 'assets/journalsPhoto/VolNopage_20220912160427.jpg', '', '', '', 1, 1, 2, '1', 2, '2022-09-12 16:04:27'),
(91, 'Outcome of Treatment of the Paediatric Locked Trigger Thumb: A Report of 28 Cases', '2012-07-01', 'assets/journalsPhoto/VolNo_20220912170223.pdf', 'Congenital trigger thumb is very rarely seen immediately after birth and true triggering is\r\nhardly ever seen. Most of them are reported after the age of 6 months and almost all are\r\npresented with locked flexed interphalangeal (IP) joint of the thumb. Hence the terminology\r\nis now disputed and is changing towards pediatric locked trigger thumb rather than congenital\r\ntrigger thumb. Evaluation of 28 trigger thumbs of 23 patients was carried out from Jan\r\n2006 to Jan 2012 at Uttara Adhunik Medical College & Hospital, Uttara. Triggering of 6\r\nthumbs relieved spontaneously in course of time and rest 22 thumbs required surgical\r\nrelease of the constricted pulley. There was very negligible residual flexion deformity of IP\r\njoints and hyperextension deformity of the metacarpophalangeal (MCP) joints. Level of\r\nsatisfaction was very high for the parents in all cases and there was no significant residual\r\nproblem and complication.', 'V - 02      N - 02', 'Sector - 9, Uttara, Dhaka ', 'Journal Uttara Adhunik Medical College', '', 'assets/journalsPhoto/VolNopage_20220912170223.jpg', '', '', '', 1, 1, 2, '1', 2, '2022-09-12 17:02:23'),
(92, 'Results of Open Reduction and Internal Fixation of Widely Displaced Multidirectionally Unstable Supracondylar Fracture of Humerus in First Decade', '2012-07-01', 'assets/journalsPhoto/VolNo_20220912171904.pdf', 'Gartland type III supracondylar fracture is unstable due to loss of cortical contact; still there\r\nmight have some attached periosteal hinge which would help to the reduce fracture. There\r\nare some subsets of type III fractures which are widely displaced and multidirectionally\r\nunstable with no remaining periosteal attachment. They may be displaced either medially\r\nor laterally. Posterolaterally displaced ones are worst of all these fractures in terms of their\r\nstability. Some literature grouped them into type IV. 40 such multidirectionally unstable\r\nfractures were treated by open reduction and internal fixation with crossed K-wires with\r\n92.5% excellent to good results.', 'V - 02      N - 02', 'Sector - 9, Uttara, Dhaka ', 'Journal Uttara Adhunik Medical College', '', 'assets/journalsPhoto/VolNopage_20220912171904.jpg', '', '', '', 1, 1, 2, '0', 2, '2022-09-12 17:19:04'),
