(72, 'Bangladesh should stay alert for 2027-28: economists', '<p>Bangladesh&#39;s economy should be on guard for 2027 and 2028 from when the country will start to collectively pay back the interest due on four or five foreign loans taken for domestic mega-projects, according to Bangladesh Economic Association (BEA).</p>\r\n\r\n<p>The BEA issued the alert while detailing its alternative national budget proposal of Tk 20.50 lakh crore for fiscal year (FY) 2022-23, which is three times higher than that of the ongoing year.</p>\r\n', 'assets/newsPhoto/megaprojects_20220604125223.jpg', '', '2022-01-06', 1, 2, '2022-05-20 19:59'),
(73, 'Economic challenges that budget 2022-23 must address', '<p>The current global political, economic and trade situations are not favourable for a developing country like Bangladesh. Covid fallout and the domino effects of the ongoing Russia-Ukraine war have had profound impacts on the global economy. Such global crises have already exerted unwanted pressure on Bangladesh&#39;s domestic economy. The immediate effects are price hikes of food and other essential items. The disruption of supply chains, induced by Covid, is worsened by the Russia-Ukraine war. The International Monetary Fund (IMF) and the World Bank are discussing the possibility of a global recession. Bangladesh, like many other developing countries, is vulnerable to the effects of any global recessionary situation.</p>\r\n\r\n<p>Bangladesh&#39;s macroeconomic challenges are manifested by high inflationary pressure, escalated current account deficit, negative growth in remittances, stress on the US dollar exchange rate, and strain on the foreign exchange reserves to support a sufficient and comfortable number of months of imports. In addition, long-standing challenges—such as job creation</p>\r\n', 'assets/newsPhoto/taxmoneybudgettbs_20220604125145.jpg', '', '2022-01-17', 1, 2, '2022-05-20 20:02'),
(74, 'U.S.- Bangladesh High-Level Economic Consultation', '<p>The meeting participants celebrated the strong and growing economic partnership between the United States and Bangladesh, a highlight of our 50 years of bilateral relations.  The United States highlighted Bangladesh’s evident potential to be a regional leader in digital trade and noted with appreciation steps taken by Bangladesh to adopt a transparent regulatory environment to secure broad-based foreign investment in its bourgeoning digital economy sector.</p>\r\n', 'assets/newsPhoto/sharelogo_20220604125117.jpg', '', '2022-01-22', 1, 2, '2022-05-20 20:06'),
(75, 'BEA places Tk 20.50 trillion budget proposal for FY23 ', '<p>The Bangladesh Economic Association (BEA) has placed a Tk 20.50 trillion (20,50,036-crore) budget proposal for the next fiscal year (FY23).</p>\r\n\r\n<p>BEA President Dr Abul Barkat placed the proposals at a press conference held at its office in the capital on Sunday.</p>\r\n\r\n<p>Dr Barkat said that they have placed such a huge budget proposal considering the global economic situation, COVID-19 pandemic, and the impact of the ongoing Russia-Ukraine war.</p>\r\n\r\n<p>The proposed budget of the BEA is around 3.40 times higher than the original national budget size of the current fiscal year which is Tk 6.03 trillion (6,03,681 crore) or 17.5 per cent of GDP.</p>\r\n', 'assets/newsPhoto/_20220604125020.jpg', '', '2022-04-25', 1, 2, '2022-05-20 20:33'),
(76, 'Mega projects’ loan payments to make 2027, 2028 tough years: Bangladesh Economic Association', '<p>The Bangladesh Economic Association (BEA) has placed a Tk 20.50 trillion (20,50,036-crore) budget proposal for the next fiscal year (FY23).</p>\r\n\r\n<p>BEA President Dr Abul Barkat placed the proposals at a press conference held at its office in the capital on Sunday.</p>\r\n\r\n<p>Dr Barkat said that they have placed such a huge budget proposal considering the global economic situation, COVID-19 pandemic, and the impact of the ongoing Russia-Ukraine war.</p>\r\n\r\n<p>The proposed budget of the BEA is around 3.40 times higher than the original national budget size of the current fiscal year which is Tk 6.03 trillion (6,03,681 crore) or 17.5 per cent of GDP.</p>\r\n', 'assets/newsPhoto/rrrrr_20220604125038.jpg', '', '2022-05-20', 1, 2, '2022-05-20 20:39'),
(77, 'Bangladesh may face debt distress from 2032: Economic Association  ', '<p><strong>Repayment of foreign loans taken for mega-projects may weigh down on the country from 2032, said the Bangladesh Economic Association, while suggesting the government to focus on its revenue base.    </strong></p>\r\n', 'assets/newsPhoto/taxmoneybudgettbs_20220604124921.jpg', '', '2022-05-30', 1, 2, '2022-05-30 22:07'),
(78, 'BEA wants white paper, body to recover black money', '<p xss=removed><strong>Bangladesh Economic Association (BEA) has demanded the government to publish a white paper and keep a provision for forming a commission in regard to <a href=\"https://images.thedailystar.net/business/finance-minister-ama-muhith-warns-banks-black-money-general-election-year-1526656\">black money</a> in the budget for fiscal year 2018-19.</strong></p>\r\n\r\n<p xss=removed>Around Tk 5 to Tk 7 lakh crore black money are used in the country&#39;s economy, BEA President Prof Abul Barkat said at a press conference at National Press Club in Dhaka today.</p>\r\n\r\n<p xss=removed>\"We propose a recovery of Tk 25,000 crore of the black money in the coming budget,\" BEA President Prof Abul Barkat said at a press conference at National Press Club in Dhaka.</p>\r\n\r\n<p xss=removed>Quoting the finance ministry, the BEA said that the total portion of the black money in the country&#39;s gross domestic product (GDP) is 42 to 80 percent.</p>\r\n\r\n<p xss=removed>It is a fact and also necessary to recover the money, Prof Abul Barkat saidwhile unveiling a 55-page budget proposal for next fiscal.</p>\r\n\r\n<p xss=removed>The association proposed a Tk 12.16 lakh crore budget for the fiscal 2018-19, which is two and a half times higher than the government&#39;s likely budgetary outlay of Tk 4.90 lakh crore for the next fiscal year.</p>\r\n\r\n<p xss=removed>The BEA comes up with its recommendation as the policy makers finalising fiscal measures which will be proposed in the parliament early next month.</p>\r\n\r\n<p xss=removed>The association proposed to fix Tk 9.90 lakh crore revenue collection target for the coming fiscal year pointing 22 new areas.</p>\r\n\r\n<p xss=removed>It said Tk 70,000-80,000 crore are siphoned off abroad every year and suggested recovery of Tk 30,000 crore by taking measures against money launderers and people sending funds abroad illicitly.</p>\r\n\r\n<p xss=removed>BEA General Secretary Jamaluddin Ahmed read out part of the proposal at the event.</p>\r\n', 'assets/newsPhoto/beasohelwb_20220604174249.jpg', '', '2022-06-01', 1, 1, '2022-06-04 17:42'),
